import React from "react";
import {Link } from "react-router-dom";

function Nav(){

    const navStyle={
        color:'black'
    };

    const myStyle ={
        display:"flex",
        "justify-content": "space-around",
        "align-items": "center",
        "min-height": "10vh",
        background: rgb(48, 182, 226),
        color: "white"
    }

    return(
    <nav sytle = {myStyle}>
        <ul  className="nav-links">
            <Link style={navStyle} to="/">
                <li>Register</li>
            </Link>

            <Link style={navStyle} to="/login">
                <li>Login</li>
            </Link>

            <Link style={navStyle} to="/predict">
                <li>Predict</li>
            </Link>
        </ul>
    </nav>
    );
}

export default Nav;
